// DenunciasScreen.jsx

import React from 'react';
import { View, Text, TouchableOpacity, StyleSheet } from 'react-native';

const DenunciasScreen = ({ navigation }) => {
  return (
    <View style={styles.container}>
      <TouchableOpacity
        style={styles.denunciaButton}
        onPress={() => navigation.navigate('DenunciaDetail', { tipo: 'Denuncias Penales', descripcion: 'Relacionadas con actividades delictivas. Pueden incluir delitos como robo, fraude, agresión, etc.' },
        { tipo: 'Denuncias Civiles', descripcion: 'Se presentan en casos de disputas entre individuos, como casos de negligencia, disputas contractuales, daños y perjuicios, entre otros.' },
        { tipo: 'Denuncias laborales', descripcion: ' Relativas a cuestiones en el lugar de trabajo, como acoso laboral, discriminación, violaciones de derechos laborales, etc' }
        ,{ tipo: 'Denuncias de orden publico', descripcion: 'Relativas a cuestiones que disturbien el orden y tranquilidad del ciudadano en publico' }
        ,{ tipo: 'Denuncias medioambientales', descripcion: 'Relativas a actividades que dañan el medio ambiente, como vertidos contaminantes, deforestación ilegal, etc.' }
        ,{ tipo: 'Denuncias de corrupción', descripcion: 'Relativas a actividades que dañan el medio ambiente, como vertidos contaminantes, deforestación ilegal, etc.' })}
      >
    
        <Text style={styles.denunciaButtonText}>Denuncias Penales</Text>
         <Text style={styles.denunciaButtonText}>Denuncias Civiles</Text>
          <Text style={styles.denunciaButtonText}>Denuncias laborales</Text>
           <Text style={styles.denunciaButtonText}>Denuncias de orden publico</Text>
            <Text style={styles.denunciaButtonText}>Denuncias Medioambientales</Text>
             <Text style={styles.denunciaButtonText}>Denuncias Denuncias de courrupcion</Text>
      </TouchableOpacity>
        {denuncias.map((denuncia, index) => (
        <TouchableOpacity
          key={index}
          style={styles.denunciaButton}
          onPress={() =>
            navigation.navigate('DenunciaDetail', {
              tipo: denuncia.tipo,
              descripcion: denuncia.descripcion,
            })
          }
        >
          <Text style={styles.denunciaButtonText}>{denuncia.tipo}</Text>
        </TouchableOpacity>
      ))}
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
  denunciaButton: {
    backgroundColor: 'red',
    padding: 10,
    borderRadius: 10,
    marginBottom: 10,
  },
  denunciaButtonText: {
    color: 'white',
    fontSize: 18,
  },
});

export default DenunciasScreen;
